import React from 'react'
import { UpdatesData } from '../../Data/Data'
import './Updates.css'

export const Updates = () => {
  return (
    <div className='Updates'>
    {UpdatesData.map((update)=>{
        return(
            <div className='Update'>
            <img src={update.img} alt/>
            <div className='noti'></div>
            
            </div>
        )
    })}
    
    
    </div>
  )
}
